Exploring 4,000 years in the history of the Jews -- from their ancient roots in the Middle East all the way to modern-day Judaism -- this exhaustive documentary weaves stories from the past and present to reveal a rich tapestry of Jewish identity. Seeking to represent the diversity of the Jewish people, director Nina Koshofer's ambitious film spotlights Jews both rich and poor, famed and obscure.

